import { Container, Row, Col } from 'reactstrap';


export default class Footer extends Component {

    render() {
        return (
            <div className="footerComponent">
            <Container>
            <Row>
            <Col m={1}>Rules of the Game</Col>
            {/* <Col><p className="rulesText">The game operates as a  normal monopoly game would but with a Twist! Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. </p></Col> */}

             <Col m={6}>Controls of the game:</Col>
             {/* <Col><p className="controlsText"> Press Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut </p></Col> */}
            </Row>
            <Row>
                <Col>1 of 3</Col>
                <Col xs={5}>2 of 3 (wider)</Col>
                <Col>3 of 3</Col>
            </Row>
            </Container>


            </div>
        )
    }
}
